import React from "react";
import {Link } from "react-router-dom"

export default function Navbar(){
    return(
        <>
          <div id="navbar">

       <div className="routelinks" id="homelink"> <Link to="/" >#VANLIFE</Link> </div>

       <div className="routelinks" id="aboutlink"> <Link to="/about" >About</Link> </div>
        </div>

         </>
    )
}
